<div class=""code example"" data-text=""label ribbon"">
    <div class=""ui two column grid"">
        <div class=""column"">
            <div class=""ui raised segment"">
                <a class=""ui blue ribbon label"">Objetivos</a>
                <p>
                    A licenciatura em NTC tem por principal finalidade
               ");
            WriteLiteral(@"     qualificar profissionais na área da comunicação
                    tecnologicamente mediada. Oferece um currículo que explora,
                    cumulativamente, a dimensão teórica e prática da
                    comunicação, com especial ênfase nos media digitais e no seu
                    enquadramento nos atuais contextos organizacionais, sociais,
                    educativos, tecnológicos e de mercado. A formação em NTC
                    valoriza uma qualificação eclética dos estudantes nas
                    dimensões da experimentação, especificação, prototipagem e
                    validação dos projetos desenvolvidos, numa lógica de
                    trabalho em grupo e constante articulação disciplinar com a
                    respetiva fundamentação teórica. Esta abordagem tem
                    permitido explorar diferentes domínios, preparando os
                    estudantes para situações profissionais diversificadas, nas
                    quais estejam envo");
            WriteLiteral(@"lvidos diferentes conceitos e domínios de
                    atuação do universo dos media digitais.
                </p>
            </div>
        </div>
        <div class=""column"">
            <div class=""ui segment"">
                <a class=""ui red right ribbon label"">Saídas profissionais</a>
                <p>
                    Os licenciados em NTC pela Universidade de Aveiro estão
                    habilitados a desempenhar funções nos seguintes contextos:
                    Organizações e instituições privadas e públicas, de todos os
                    setores de atividade, que desenvolvam, produzam, incorporem,
                    comercializem ou utilizem produtos e aplicações multimédia,
                    baseados em Internet ou em suportes off-line, para aplicação
                    em problemas de comunicação humana e/ou organizacional.
                    Integração em equipas de conceção, desenvolvimento,
                    implementação, consultoria, comercializa");
            WriteLiteral(@"ção, avaliação ou
                    distribuição de produtos e aplicações multimédia baseados em
                    Internet ou em suportes off-line. Operação, gestão e
                    manutenção de sistemas, produtos e aplicações de comunicação
                    multimédia.
                </p>
            </div>
        </div>
    </div>
</div>

