<div class=""code example"" data-text=""styled accordion"">
    <div class=""ui styled accordion"">
        <div class=""active title"">
            <i class=""dropdown icon""></i>
            UA recebe novos estudantes com mega piquenique
        </div>
        <div class=""active content"">
            <p>
                Será, provavelmente, o maior piquenique académico do mundo.
                Com 800 toalhas de mesa estendidas no relvado da alameda
                central da Universidade de Aveiro (UA), onde vão almoçar os
                mais de 2000 caloiros da Academia, o piquenique é o ponto alto");
            WriteLiteral(@"
                do programa de acolhimento aos novos estudantes. Mas os
                números que justificariam uma candidatura ao Guinness podem
                aumentar já que o convite para ‘piquenicar’ foi também feito
                aos mais de 15 mil membros da comunidade UA. Com a presença de
                três bandas a atuarem ao vivo, o mega piquenique acontece dia
                17 de setembro, a partir das 9h30.
            </p>
        </div>
        <div class=""title"">
            <i class=""dropdown icon""></i>
            Matrículas na UA para novos alunos em 10 passos essenciais
        </div>
        <div class=""content"">
            <p>
                As matrículas vão decorrer por cursos de 10 a 14 de setembro e
                por senhas de atendimento que terás de tirar online e que
                estarão disponíveis após a divulgação oficial das colocações
                pela Direcção-Geral do Ensino Superior (DGES) prevista para as
                00h00 de 10 d");
            WriteLiteral(@"e setembro.
            </p>
        </div>
        <div class=""title"">
            <i class=""dropdown icon""></i>
            UA acolhe 410 estudantes estrangeiros de 38 países
        </div>
        <div class=""content"">
            <p>
                Organizado conjuntamente pelo Gabinete de Relações
                Internacionais da UA e pela Erasmus Students Network (ESN) -
                Aveiro, o programa da “Semana de Acolhimento” para receber os
                novos estudantes decorre de 10 a 21 de setembro e incluirá
                visitas ao Campus e à região de Aveiro, encontros com
                estudantes locais, festividades e uma cerimónia oficial de
                boas-vindas, na quarta-feira, dia 19.
            </p>
        </div>
    </div>
</div>

